import React from "react";
import CardTemplate from "./Dashboard";
import { Container } from 'react-bootstrap'
import HeaderNav from "./HeaderNav";
import SideNav from "./SideNav";
class Main extends React.Component {
    render() {
        return (
            <div>
                <HeaderNav />
                <div className='row'>
                    <div  className='col-1'><SideNav /></div>
                    <div className='col-5'>
                    <Container>
                       <Row>
                                <td style={{ padding: '20px' }}><CardTemplate cardName='Quote & Order Management' quoteImage='far fa-sticky-note' identify='true' /></td>
                                <td style={{ padding: '20px' }}><CardTemplate cardName='Purchase Orders' quoteImage='fas fa-check' identify='true' /></td>
                                <td style={{ padding: '20px' }}><CardTemplate cardName='Inventory Management' quoteImage='fad fa-tree-palm' identify='true' /></td>
                                </Row>
                                <Row>
                            
                           
                                <td style={{ padding: '20px' }}><CardTemplate cardName='Tools & Settings' quoteImage='fas fa-tools' /></td>
                                <td style={{ padding: '20px' }}><CardTemplate cardName='Reports' quoteImage='far fa-chart-bar' /></td>
                                <td style={{ padding: '20px' }}><CardTemplate lastCard='true' /></td>
                           </Row>
                        
                    </Container>
                </div>
                </div>
                
            </div>

        )
    }
}
export default Main
